import { useHistory } from 'react-router';

export const Welcome = () => {
    const history = useHistory();

    const handleClick = () => {
        history.push('/Name');
    }
    return (
        <>
        <p>Welcome to our application form</p>
        <button type="submit" onClick = {handleClick}>
            Start
        </button>
        </>
    );
};
